script: |
  super -f tsv -I q951.sql | sort > q951.out

vector: true

inputs:
  - name: q951.sql
    data: |
      SELECT - 79 FROM tab1 AS cor0 WHERE NOT + 16 IN ( + col0 * - 71 + + col1, CAST ( 67 AS INTEGER ) / - + 32, col0 );
  - name: tab1

outputs:
  - name: q951.out
    data: |
      -79
      -79
      -79
